  false,\n\t\"url\": null,\n\t\"notes\": \"Introduced Arctic foxes were eliminated
  from Nizki and Alaid islands in the late 1970's. Due to the unavailability of a
  support vessel, mainland reared Aleutian Canada geese were transplanted from an
  aircraft at nearby Shemya Air Force Base to \"Camp Cove\" at Nizki by inflatable
  boats on 15 August 1981. Only three geese from the 1981 release at Nizki Island
  were found in 1983. Those three birds were among the birds found on the island in
  May 1982. Although one of the birds was an apparent loner, birds 728 and 734 were
  found together with other birds until 28 May when 728 and A92 (from the 1982 Buldir-Agattu
  transplant) were found alone together at Camp Cove for the first time. They remained
  together until our departure from Nizki at 1700 on 3 June 1983. There were no observations
  of nesting activity during the investigations.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
